// define a function that searches for the largest 3-digit number that appears in a given string
function f_gold(num) {
    for (let i = 9; i >= 0; i--) {
        // create a string of three consecutive i's
        let t = Array(3).fill(String(i)).join("");
        // check if the string t appears in the input string num
        if (num.includes(t)) {
            // return the string t if it appears in num
            return t;
        }
    }
    // return an empty string if no 3-digit number appears in num
    return '';
}
```
